import React,{useState} from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import { Container, Row, Col } from 'react-bootstrap';
import InputGroup from 'react-bootstrap/InputGroup'
import styles from "../components/contact_form/contact_form.module.css";
import CustomButton from '../utils/CustomButton'
export default function FormExample() {
    const [validated, setValidated] = useState(false);
  
    const handleSubmit = (event) => {
      const form = event.currentTarget;
      if (form.checkValidity() === false) {
        event.preventDefault();
        event.stopPropagation();
      }
  
      setValidated(true);
    };
  
    return (
      <Form noValidate validated={validated} onSubmit={handleSubmit} className={styles.submitForm}>
           <h4 className={styles.Title}>Masz pytania?</h4>
           <p class="pt-3" style={{color:'var(--grey)',fontSize:"12px"}}>Napisz do nas, nasi fachowcy chętnie Ci pomogą</p>
        <Form.Row>
          <Form.Group as={Col} md="12" controlId="validationCustom01">
            
            <Form.Control
              required
              type="text"
              className={`form-control ${styles.formField}`}
              placeholder="Twoje imię"
             
            />
            <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
          </Form.Group>
          <Form.Group as={Col} md="12" controlId="validationCustom02">
            <Form.Control
              required
              type="email"
              placeholder="Last name"
              defaultValue="Twój e-mail"
              className={`form-control ${styles.formField}`}
            />
            <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
          </Form.Group>
          <Form.Group as={Col} md="12" controlId="validationCustomUsername">
            <InputGroup hasValidation>
           
              <Form.Control
                type="text"
                placeholder="Temat wiadomości"
                aria-describedby="inputGroupPrepend"
                className={`form-control ${styles.formField}`}
                required
              />
              <Form.Control.Feedback type="invalid">
                Please choose a username.
              </Form.Control.Feedback>
            </InputGroup>
          </Form.Group>
        </Form.Row>
        <Form.Row>
          <Form.Group as={Col} md="12" controlId="validationCustom03">
            <Form.Control
             type="text" 
             placeholder="Treść wiadomości"
              required
              className={`form-control ${styles.formField}`}
              as="textarea" rows={3}
               />
            <Form.Control.Feedback type="invalid">
              Please provide a valid city.
            </Form.Control.Feedback>
          </Form.Group>
        </Form.Row>
        <Form.Group>
          <Form.Check
            required
            label="Agree to terms and conditions"
            feedback="You must agree before submitting."
            
          />
        </Form.Group>
        <CustomButton title={'Wyślij zapytanie'}/>
      </Form>
    );
  }
